import React from "react";
import { connect } from "react-redux";
import { Actions as authActions } from "../../redux/auth";
import { EuiFlexGroup, EuiFlexItem, EuiLink, EuiButton } from "@elastic/eui";
import { useNavigate } from "react-router-dom";
import styled from "styled-components";

const AvatarMenu = styled.div`
  display: flex;
  justify-content: space-between;
  min-width: 300px;

  & .avatar-actions {
    margin-left: 2rem;
  }
`;

function Navbar({ logUserOut }) {
  const navigate = useNavigate();

  const handleLogout = () => {
    logUserOut();
    navigate("/");
  };

  return (
      <EuiFlexGroup justifyContent="spaceBetween">
        <EuiFlexItem grow={1}></EuiFlexItem>
        <EuiFlexItem grow={1}>
          <EuiButton>
            <EuiLink onClick={() => handleLogout()}>Sair</EuiLink>
          </EuiButton>
        </EuiFlexItem>
      </EuiFlexGroup>
  );
}

export default connect((state) => ({ user: state.auth.user }), {
  logUserOut: authActions.logUserOut,
})(Navbar);
